class Helado {
  constructor(id, imagen, nombre, enStock = 0, descuento = 0) {
    this.id = id;
    this.imagen = imagen;
    this.nombre = nombre;
    this.enStock = enStock;
    this.descuento = descuento;

    this.datosCompra = null; /* Bridge */
  }
}

export default Helado;
